@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'frontend';
}
<h1>Angular Router</h1>
<nav>
  <a routerLink="/search" routerLinkActive="active" ariaCurrentWhenActive="page">Search Contact</a>
  <a routerLink="/list" routerLinkActive="active" ariaCurrentWhenActive="page">List Contacts</a>
  <a routerLink="/add" routerLinkActive="active" ariaCurrentWhenActive="page">Add Contact</a>

</nav>
